import XCTest
@testable import Specs

final class EmbedTests: XCTestCase {    
    func testBase64() {
        let embed = Access.Embed(value: "data:image/jpeg;base64,")
        
        XCTAssertEqual("data:image/jpeg", embed.prefix)
    }
    
    func testAbout() {
        XCTAssertEqual("about:blank", Access.Embed(value: "about:blank").prefix)
    }
}
